VALUES ('3760031310116', 'Sel fin de Guérande.', 'te gros sel gris est récolté chaque jour dété le fond argileux des marais salants. Il n\'est ni lavé, ni raffiné et ne contient aucun produit d\'adjonction. Le sel fin de table est obtenu à partir du gros sel séché, broyé et tamisé. Il est destiné à l\'assaisonnement des plats et à la table. Coarse grey salt is harvested every day in summerfrom the clay beds of the salt marshes, which give the salt its grey colour. Greg salt is unwashed, unrefined and additivefree. Thefine table salt is made from dried grey salt, whichis crushed and sifted. It can be usedfor seasoning and as table Salt. Das grobe, graue Salz wird im Sommer tüglich cm tonhaltigen Grund der Salzgürten abgeschôpft. ts wird weder gewaschen noch raffiniert und enthàlt keinerlei Zusatzstoffe. Dasfeine Tafelsalz wird aus dem groben Salz gewonnen, getrocknet gemahlen und gesiebt. ts dient zum Würzen von Gerichten bei Tisch. Grofzeezout wordt op zomerdagen gewonnen op de kleiachtige bodem van zoutpannem Grof zeezout wordt niet gewassen ofgeraffineerden bevat geen toegevoegde stoffen. Door het te drogen, te malen en te zeven bekomt menflJfl tafelzout. Het wordt gebruikt om gerechten op smaak te brengen. coNStGNE 3', 'https://static.openfoodfacts.org/images/products/376/003/131/0116/front_fr.3.400.jpg', '0', '0', '0', '0', '', '0', '100', '39.3700787401575', '', '0');

